using System;using HECSFramework.Core;using Newtonsoft.Json;using HECSFramework.Serialize;using Components;namespace HECSFramework.Serialize{	[JsonObject, Serializable]	public partial struct PlayerLevelComponentJSONResolver : IJSONResolver<PlayerLevelComponent,PlayerLevelComponentJSONResolver>	{		[JsonProperty("Level")]		public int Level;		public PlayerLevelComponentJSONResolver In(ref PlayerLevelComponent playerlevelcomponent)		{			this.Level = playerlevelcomponent.Level;			return this;		}		public void Out(ref PlayerLevelComponent playerlevelcomponent)		{			playerlevelcomponent.Level = this.Level;		}	}}